import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import logo from '../assets/ux/techhub/TechHub-logotype.png'

export default function UxWorkThumb(props) {
    const uximages = require.context('../../public/assets', true);
    let logotype = uximages(`${props.logotype}`);

    return (
        <div>
            <Link to={"/ux-design/"+props.path}>{props.name}</Link>
            <h2>{props.name}</h2>
            <img width="300" src={logotype}></img>
        </div>
    )
}
